        public Form1()
        {
            InitializeComponent();

            DesenharGrafico();
        }

        void DesenharGrafico()
        {
            grafico.Image = new Bitmap(grafico.Width, grafico.Height);
            Graphics g = Graphics.FromImage(grafico.Image);
            Pen pen1 = new Pen(Color.Red);
            Pen pen2 = new Pen(Color.Yellow);

            //A cada 10 pixels, há alteração de 1 real 
            int multiplicadorY = 10;
            //A cada 10 pixels, há alteração de 1 dia da cotação
            int multiplicadorX = Convert.ToInt32(txtEscalaX.Text);

            int minimoEntreOsDois = Convert.ToInt32(real.Min());
            if (previsto.Min() < minimoEntreOsDois)
            {
                minimoEntreOsDois = Convert.ToInt32(previsto.Min());
            }

            DesenharLinharAuxiliaresDoGrafico(g, minimoEntreOsDois, 1, multiplicadorY, multiplicadorX);

            minimoEntreOsDois *= multiplicadorY;

            for (int i = 40 / multiplicadorX; i < previsto.Count() - 41; i++)
            {
                Point pontoReal1 = new Point(i * multiplicadorX, grafico.Height - Convert.ToInt32(real[i] * multiplicadorY) + minimoEntreOsDois);
                Point pontoReal2 = new Point((i + 1) * multiplicadorX, grafico.Height - Convert.ToInt32(real[i + 1] * multiplicadorY) + minimoEntreOsDois);

                Point pontoPrevisao1 = new Point(i * multiplicadorX, grafico.Height - Convert.ToInt32(previsto[i] * multiplicadorY) + minimoEntreOsDois);
                Point pontoPrevisao2 = new Point((i + 1) * multiplicadorX, grafico.Height - Convert.ToInt32(previsto[i + 1] * multiplicadorY) + minimoEntreOsDois);

                g.DrawLine(pen1, pontoReal1, pontoReal2);
                g.DrawLine(pen2, pontoPrevisao1, pontoPrevisao2);
            }
        }

        void DesenharLinharAuxiliaresDoGrafico(Graphics g, int minimo, int unidade, int multiplicadorEscalaY, int multiplicadorEscalaX)
        {
            Pen pen = new Pen(Color.LightGray);

            //HORIZONTAL
            for (int i = grafico.Height - 1; i > 1 - 1; i -= multiplicadorEscalaY * 2)
            {
                Brush b = pen.Color == Color.LightGray ? Brushes.LightGray : (pen.Color == Color.LightSkyBlue ? Brushes.LightSkyBlue : Brushes.LightGreen);

                g.DrawString("R$ " + minimo.ToString(), new Font("Arial", 8), b, (float)0, (float)i - multiplicadorEscalaY);
                minimo += 2;

                Point pontoReal1 = new Point(0, i);
                Point pontoReal2 = new Point(grafico.Width, i);

                g.DrawLine(pen, pontoReal1, pontoReal2);

                //alterna a cor da linha
                if (pen.Color == Color.LightGray)
                    pen.Color = Color.LightSkyBlue;
                else if (pen.Color == Color.LightSkyBlue)
                    pen.Color = Color.LightGreen;
                else
                    pen.Color = Color.LightGray;
            }

            //VERTICAL
            for (int i = 40; i < grafico.Width; i += multiplicadorEscalaX)
            {
                Point pontoReal1 = new Point(i, 0);
                Point pontoReal2 = new Point(i, grafico.Height);

                g.DrawLine(pen, pontoReal1, pontoReal2);

                //alterna a cor da linha
                if (pen.Color == Color.LightGray)
                    pen.Color = Color.LightSkyBlue;
                else
                    pen.Color = Color.LightGray;
            }
        }

        private void button1_Click(object sender, EventArgs e)
        {
            DesenharGrafico();
        }

